    data logged by the Scientific Computer System (SCS) aboard NOAA Ship Gordon Gunter
    in the North Atlantic Ocean from 2014-03-11 to 2014-04-28. Office of Marine and
    Aviation Operations (OMAO) personnel aboard the ship submitted these data and associated
    metadata to NODC. In addition, NODC Accession 0118186 contains supplementary cruise-level
    metadata, which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO
